import React from 'react'
import JobElement from '../Items/JobElement'
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const JobTable = (props) => {
// console.log(props)
  return(
 <> 
   <label htmlFor="search">Search by Title </label>
   <input type="text" value ={props.inputValue}  onChange={props.jobFilterOnChange}/>
     <div>
      <TableContainer component={Paper}>
      <Table  aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Title</TableCell>
            <TableCell align="right">Deadline</TableCell>
            <TableCell align="right">Skills Required</TableCell>
            <TableCell align="right">Posted By</TableCell>
            <TableCell align="right">Type</TableCell>
            <TableCell align="right">Salary</TableCell>
            <TableCell align="right">Duration</TableCell>
            <TableCell align="right">Rating</TableCell>
            <TableCell align="right">Status</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
        {
           props.jobs.map(job => {
           return <JobElement job={job} key={job._id} email={props.email} user={props.user}/>
           })
        }
        </TableBody>
      </Table>
    </TableContainer>
        {/* <SimpleModal user={props.user}/> */}
     </div>
  </>
    )
   }


export default JobTable
